import React from 'react';
//import './App.css';


var activeClass ='';
if (props.selected=== true) {
  activeClass= "feelingSelected"
} else {
  activeClass= ""
}



function FeelingComponent(props) {
  return (
    <div className={'FeelingComponent' + ' '+ props.color + activeClass}> 
      {props.feeling} 
    </div>
  );
}

export default FeelingComponent;
